import React from "react";
import Navbar from "./navbar";
import Footer from "./footer";
const makeReview = () => {
    return (
        <div className="Reviews">
            <header>
                <Navbar />
                <div className="jumbo">
                    <h1>EXPERIENCE Geneva</h1>
                </div>
            </header>
            <main>
                <div className="subtitle">
                    <h2>Make Review</h2>
                </div>
                <NavLink to="/makeReview">
                    <button className="makeReview-button">Old Main</button>
                </NavLink>
            </main>
            <footer>
                <Footer />
            </footer>
        </div>
    );
};

export default makeReview;
